import styled from "styled-components";
import { motion } from "framer-motion";

const ContactUsComponentStyle = styled(motion.div)`
  margin-top: 150px;
  background-color: #f2c14e;
  width: calc(100% - 80px);
  height: auto;
  padding: 40px;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  justify-content: space-between;
  .section1 {
    display: flex;
    flex-direction: column;
    span {
      margin-bottom: 10px;
      color: #111111;
      font-size: 14px;
    }
  }
  .section2 {
    display: flex;
    flex-direction: row;
    .first,
    .second {
    }
  }
`;

const Expolore = `Explore Design features Prototyping Design systems Pricing Customers Security Integrations Contact`;

const ContactUsComponent = () => {
  return (
    <ContactUsComponentStyle>
      <div className="section1">
        {Expolore.split(" ").map((e, i) => {
          return <span className={(i = 0 ? "title" : "elmnt")}> {e}</span>;
        })}
      </div>
      <div className="section2">
        <div className="first">
          <div className="first1">
            {Expolore.split(" ").map((e, i) => {
              return <span className={(i = 0 ? "title" : "elmnt")}> {e}</span>;
            })}
          </div>
          <div className="first2">
            {Expolore.split(" ").map((e, i) => {
              return <span className={(i = 0 ? "title" : "elmnt")}> {e}</span>;
            })}
          </div>
        </div>
        <div className="second">
          <div className="first1">
            {Expolore.split(" ").map((e, i) => {
              return <span className={(i = 0 ? "title" : "elmnt")}> {e}</span>;
            })}
          </div>
          <div className="first2">
            {Expolore.split(" ").map((e, i) => {
              return <span className={(i = 0 ? "title" : "elmnt")}> {e}</span>;
            })}
          </div>
        </div>
      </div>
    </ContactUsComponentStyle>
  );
};

export default ContactUsComponent;
